  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:19.170067\",\n\t\"name\": \"evaluation-of-water-monitoring-program-at-ruby-lake-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this report was to document
  an assessment to determine if actions are needed to improve the accuracy and consistency
  of an existing flow monitoring network. This assessment included a summary of results
  used to recommend the minimum days required between measurements to properly interpolate
  between flow measurements, and to recommend any changes to flow calculation procedures
  to improve calculation accuracy.  We conducted an experiment where we manipulated
  boards at 4 selected locations and measured flow immediately after board removal
  for several days. Results from the board pulling experiment were not conclusive
  because results varied between sites.  A measurement frequency to 1 month did not
  have a substantial impact on total annual flow from the collection ditch to wetland
  management units, but did substantially impact the net inflow to some units. A 2-week
  measurement schedule appears to capture spring peak flow better than a 1 to 2 month
  sampling interval.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
